&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4132410322/" title="Riverboat Paddlewheel"&gt;&lt;img src="http://farm3.static.flickr.com/2773/4132410322_f752bf8191_m.jpg" width="240" height="160" alt="Riverboat Paddlewheel" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Wandering along the river front in Alexandria, and not finding much to photograph on a cloudy Saturday morning.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4150124872/" title="Bald Cypress in Morning Fog"&gt;&lt;img src="http://farm3.static.flickr.com/2772/4150124872_870cd66149_m.jpg" width="240" height="160" alt="Bald Cypress in Morning Fog" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;A foggy day at Roosevelt Island. Typically this bald cypress blends into the background, but its fall color against the other bare trees and the fog obscuring the background made it stand out.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4151796460/" title="Still Pond"&gt;&lt;img src="http://farm3.static.flickr.com/2689/4151796460_d2e98541d7_m.jpg" width="240" height="160" alt="Still Pond" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;A small pond along the Billy Goat Trail Section A&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4279075159/" title="Icebound"&gt;&lt;img src="http://farm5.static.flickr.com/4055/4279075159_e2c3f21c5a_m.jpg" width="180" height="240" alt="Icebound" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Icebound boats on the Potomac.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4281011395/" title="Fox on Ice"&gt;&lt;img src="http://farm5.static.flickr.com/4061/4281011395_7dae956501_m.jpg" width="240" height="180" alt="Fox on Ice" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Fox crossing the icy potomac river. This is one of two foxes that were taking advantage of the frozen river to explore the islands of the marsh.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4288658035/" title="Lone tree and ice"&gt;&lt;img src="http://farm5.static.flickr.com/4022/4288658035_2962d71ce6_m.jpg" width="180" height="240" alt="Lone tree and ice" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;A lone tree on an island in the Dyke Marsh Wildlife Preserve stands out on the horizen. I particularly like the contrast between the grey ice in the foreground and the colorful sky.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4289422132/" title="Blue Heron and Sun"&gt;&lt;img src="http://farm5.static.flickr.com/4035/4289422132_7a02e45dd5_m.jpg" width="180" height="240" alt="Blue Heron and Sun" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;More evidence that I need to get a long telephoto lens. Both this and the &amp;quot;Fox on Ice&amp;quot; picture are heavily cropped to show the subject at some reasonable size. Fortunately, I've almost saved up for that telephoto lens, so my next wildlife shots should be a lot better!&lt;br /&gt;
&lt;br /&gt;
Incidently, the sun wasn't really that big - its actually behind a cloud and its just the overexposed area that is forming the white disk.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4294539125/" title="Cattails"&gt;&lt;img src="http://farm5.static.flickr.com/4056/4294539125_8e4fd0108a_m.jpg" width="240" height="160" alt="Cattails" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Narrow-leafed cattail (Typha angustifolia) silhoutted against the  rising sun on a  chilly winter morning.&lt;/p&gt;

