&lt;p&gt;Trying out my new 70-300mm lens&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4309649149/" title="Clouds Above the Marsh"&gt;&lt;img src="http://farm5.static.flickr.com/4072/4309649149_b656eb10d3_m.jpg" width="240" height="160" alt="Clouds Above the Marsh" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Early morning clouds over Dyke Marsh&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4483315551/" title="DC Sunset II"&gt;&lt;img src="http://farm5.static.flickr.com/4044/4483315551_e3bf9652ee_m.jpg" width="240" height="160" alt="DC Sunset II" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Silhouettes of an equstrian Ulysses S. Grant statue and the Wshington Monument against the setting sun&lt;/p&gt;

