&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4680478878/" title="Redwing Blackboard"&gt;&lt;img src="http://farm5.static.flickr.com/4005/4680478878_0608e9bccb_m.jpg" width="180" height="240" alt="Redwing Blackboard" /&gt;&lt;/a&gt;&lt;/p&gt;

