&lt;p&gt;Female Redwing Blackbird&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4696280016/" title="Bay Bridge"&gt;&lt;img src="http://farm5.static.flickr.com/4056/4696280016_cb4a06bd84_m.jpg" width="240" height="160" alt="Bay Bridge" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Bay Bridge from the docks of San Francisco. I took this on a morning walk before attending the Google I/O conference.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4714225338/" title="Cobweb Thistle"&gt;&lt;img src="http://farm5.static.flickr.com/4063/4714225338_12df41a341_m.jpg" width="240" height="160" alt="Cobweb Thistle" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Cobweb Thistles backlit by the rising sun, with the Golden Gate Bridge in the bckground.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/semprebon/4737493572/" title="Seaside Daisy"&gt;&lt;img src="http://farm5.static.flickr.com/4096/4737493572_4cd8a1671c_m.jpg" width="180" height="240" alt="Seaside Daisy" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;A seaside daisy (Erigeron glaucus) greets the rising sun. This was taken on the path from Point Bonita Lighthouse (unfortunately closed at the time).&lt;/p&gt;

