&lt;p&gt;Faces on display at the Smithsonian Folklife Festival from the Smithsonian Inside Out exhibit.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/semprebon/"&gt;semprebon&lt;/a&gt; posted a photo:&lt;/p&gt;

